function Carousel(){

    var carImages=[
        {
            src: require("../Images/rivulet.jpg"),
            alt: "Image1",
        },
        {
            src: "../Images/structure.png",
            alt: "Image2",
        },
        {
            src: "../Images/fastBoy.jpg",
            alt: "Image3",
        },
    ]

    return (
        <div>
            {carImages.map((img, index) => {
                return(<img className="w-full h-full" src={require(img.src)} alt={img.alt} key={index}></img>)
            })}
        </div>
    )
}

export default Carousel
